import "./styles.css";

export default function ListingAd({ pic, title, address, description }) {
  return (
  <div className="App">
      <div className="card">
        {/* Image Container */}
        <div className="imageContainer">
          <img 
            className="mainPic" 
            src={pic} 
            alt={title}
          />
          <div className="badge">LAUNCHING SOON</div>
        </div>

        {/* Content Container */}
        <div className="mainContent">
          {/* Header Section */}
          <div className="header">
            <div className="leftSection">
              <div className="iconContainer">
                <svg className="buildingIcon" fill="currentColor" viewBox="0 0 24 24">
                  <path d="M3 9h4V5H3v4zm0 5h4v-4H3v4zm5 0h4v-4H8v4zm5 0h4v-4h-4v4zM8 9h4V5H8v4zm5-4v4h4V5h-4zm5 9h4v-4h-4v4zM3 19h4v-4H3v4zm5 0h4v-4H8v4zm5 0h4v-4h-4v4zm5 0h4v-4h-4v4zm0-14v4h4V5h-4z"/>
                </svg>
              </div>
              </div>
              </div>
</div>
</div>
      {/* <div className="card">
      <img className="mainPic" width="300" height="500" src={pic} />
